import { useEffect, useState } from "react";

export default function UploadedDetails() {
  const [patients, setPatients] = useState([]);
  const [filters, setFilters] = useState({ district: "", disease: "", date: "" });

  // Fetch patients
  const fetchPatients = async () => {
    const query = new URLSearchParams(filters).toString();
    const res = await fetch(`http://localhost:4000/patients?${query}`);
    const data = await res.json();
    setPatients(data);
  };

  useEffect(() => {
    fetchPatients();
  }, []);

  // Submit all
  const submitAll = async () => {
    try {
      const res = await fetch("http://localhost:4000/submitAll", { method: "POST" });
      const data = await res.json();
      alert(data.message);
      setPatients([]);
    } catch (err) {
      console.error(err);
      alert("Failed to submit all patients");
    }
  };

  const handleFilterChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const applyFilters = () => {
    fetchPatients();
  };

  return (
    <div className="min-h-screen p-4 sm:p-8 bg-gray-100">
      <h1 className="text-3xl font-bold mb-6 text-center">Uploaded Patient Details</h1>

      <div className="flex gap-4 mb-6 justify-center">
        <input name="district" placeholder="District" value={filters.district} onChange={handleFilterChange} className="border p-2 rounded"/>
        <input name="disease" placeholder="Disease" value={filters.disease} onChange={handleFilterChange} className="border p-2 rounded"/>
        <input type="date" name="date" value={filters.date} onChange={handleFilterChange} className="border p-2 rounded"/>
        <button onClick={applyFilters} className="bg-blue-500 text-white px-4 py-2 rounded">Filter</button>
      </div>

      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
        {patients.map((p) => (
          <div key={p._id} className="bg-white p-4 rounded-xl shadow border border-gray-200">
            <p><strong>Name:</strong> {p.name}</p>
            <p><strong>Age:</strong> {p.age}</p>
            <p><strong>Gender:</strong> {p.gender}</p>
            <p><strong>Disease:</strong> {p.disease}</p>
            <p><strong>District:</strong> {p.district}</p>
            <p><strong>Number:</strong> {p.number}</p>
            <p><strong>Address:</strong> {p.address}</p>
            <p><strong>Prescription:</strong> {p.filePath ? "Uploaded" : "Not uploaded"}</p>
            <p><strong>Date:</strong> {new Date(p.date).toLocaleDateString()}</p>
          </div>
        ))}
      </div>

      <div className="flex justify-center mt-8">
        <button onClick={submitAll} className="bg-green-500 hover:bg-green-600 text-white px-6 py-3 rounded-xl">
          Submit All
        </button>
      </div>
    </div>
  );
}
